import React from "react";
import styled from "styled-components";

export const Div = styled.div`
  text-align: center;
  margin-top: 40px;

  @media screen and (max-width: 810px) {
    margin-top: 250px;
  }
`;

export const ConstCostEstimator = () => {
  return (
    <div>
      <h4>Construction Cost Estimator</h4>
      <div>
        <input type="checkbox" />
      </div>
    </div>
  );
};
